import React from 'react';
import './App.css';
import landingPage from './pages/landing';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";


function App() {
  return (
    <div>
      <Router>
        <Routes>
            <Route exact path="/" element={<landingPage/>} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
